import './App.css';

function App() {
  return (
    <div className="App">

      <div class="row">
        <div class="col-sm-4">
          <h2>Photo 1</h2>        
        </div>
        <div class="col-sm-4">
          <h2> Photo 2 </h2>
        </div>
        <div class="col-sm-4">
          <h2>Morphed Photo</h2>
        </div>   

      </div>


    </div>
  );
}

export default App;
